export function generateReport(data = null) {
  updateSelectionStateFromDOM();

  const analytics = data || reportState.analytics;
  if (!analytics) {
    throw new Error("Please analyze a skill before generating report.");
  }

  const sections = buildReportSections({
    ...analytics,
    country: analytics.country || reportState.selectedCountry,
    city: analytics.city || reportState.selectedCity,
    skill: analytics.skill || reportState.selectedSkill,
    experience: reportState.selectedExperience,
  });

  const report = {
    meta: {
      platform: "Region-Based Skill Half-Life Intelligence Platform",
      reportType: "Career Intelligence Report",
      generatedAtISO: getISODateString(),
      generatedAtReadable: getFriendlyDate(new Date()),
      userName: reportState.userName,
    },
    context: {
      country: reportState.selectedCountry,
      city: reportState.selectedCity,
      skill: reportState.selectedSkill,
      experience: reportState.selectedExperience,
    },
    analytics: {
      ...analytics,
      volatilityIndex: calculateVolatilityIndex(analytics.demand || []),
      forecastSlope: calculateForecastSlope(analytics.demand || []),
      stabilityScore: buildStructuredMetrics(analytics).stabilityScore,
    },
    sections,
    exportOptions: {
      pdf: true,
      json: true,
      shareLink: "future-ready",
    },
  };

  reportState.latestReport = report;
  reportState.generatedAt = report.meta.generatedAtISO;

  return report;
}

export function renderStabilityRadarChart(targetCanvas, analytics = {}, existingInstance = null) {
  if (!targetCanvas || typeof Chart === "undefined") {
    return existingInstance;
  }

  const context = targetCanvas.getContext("2d");
  if (!context) {
    return existingInstance;
  }

  if (existingInstance) {
    existingInstance.destroy();
  }

  const radarHost = targetCanvas.parentElement;
  if (radarHost) {
    radarHost.style.background = "radial-gradient(circle at center, rgba(0,255,200,0.15) 0%, rgba(0,255,200,0.05) 40%, transparent 70%)";
    radarHost.style.boxShadow = "inset 0 0 36px rgba(125, 249, 255, 0.1), inset 0 0 16px rgba(0, 255, 200, 0.08)";
  }

  const labels = ["Stability", "Demand", "Growth", "Longevity", "Volatility"];
  const sampleData = [85, 78, 88, 82, 65];

  const demandSeries = Array.isArray(analytics.demand) ? analytics.demand : [];
  const demandAverage = demandSeries.length
    ? Math.round(demandSeries.reduce((sum, value) => sum + Number(value || 0), 0) / demandSeries.length)
    : sampleData[1];

  const growthRaw = analytics.growth_trend;
  const growthScore = typeof growthRaw === "number"
    ? Math.max(0, Math.min(100, growthRaw))
    : /high|grow/i.test(String(growthRaw || ""))
      ? 88
      : /medium|stable/i.test(String(growthRaw || ""))
        ? 72
        : sampleData[2];

  const stabilityScore = Math.max(0, Math.min(100, Number(analytics.stability_score ?? sampleData[0])));
  const longevityScore = Math.max(0, Math.min(100, Number(analytics.half_life ?? 5.9) * 14));
  const volatilityRaw = Number(analytics.volatility_index ?? 3.5);
  const volatilityScore = Math.max(0, Math.min(100, Number.isFinite(volatilityRaw) ? Math.round(100 - (volatilityRaw * 10)) : sampleData[4]));

  const radarData = analytics?.radar_scores && Array.isArray(analytics.radar_scores) && analytics.radar_scores.length === labels.length
    ? analytics.radar_scores.map((value, index) => {
      const numeric = Number(value);
      return Number.isFinite(numeric) ? Math.max(0, Math.min(100, numeric)) : sampleData[index];
    })
    : [
      Number.isFinite(stabilityScore) ? stabilityScore : sampleData[0],
      Number.isFinite(demandAverage) ? demandAverage : sampleData[1],
      Number.isFinite(growthScore) ? growthScore : sampleData[2],
      Number.isFinite(longevityScore) ? longevityScore : sampleData[3],
      Number.isFinite(volatilityScore) ? volatilityScore : sampleData[4],
    ];

  const strokeGradient = context.createLinearGradient(0, 0, 0, targetCanvas.height || 320);
  strokeGradient.addColorStop(0, "#00ffc8");
  strokeGradient.addColorStop(1, "#00bfff");

  const premiumRadarPlugin = {
    id: "enterpriseRadarCinematic",
    afterInit(chart) {
      chart.$radarPulseFrame = 0;

      const animatePulse = () => {
        if (!chart?.ctx) {
          return;
        }
        chart.$radarPulseFrame += 0.035;
        chart.draw();
        chart.$radarPulseRaf = requestAnimationFrame(animatePulse);
      };

      chart.$radarPulseRaf = requestAnimationFrame(animatePulse);
    },
    beforeDatasetDraw(chart, args) {
      if (args.index !== 0) {
        return;
      }
      const chartCtx = chart.ctx;
      chartCtx.save();
      chartCtx.shadowBlur = 20;
      chartCtx.shadowColor = "#00ffc8";
    },
    afterDatasetDraw(chart, args) {
      if (args.index !== 0) {
        return;
      }
      chart.ctx.restore();
    },
    afterDestroy(chart) {
      if (chart.$radarPulseRaf) {
        cancelAnimationFrame(chart.$radarPulseRaf);
        chart.$radarPulseRaf = null;
      }
    },
  };

  return new Chart(context, {
    type: "radar",
    plugins: [premiumRadarPlugin],
    data: {
      labels,
      datasets: [
        {
          label: "Stability Radar",
          data: radarData,
          backgroundColor: "rgba(0,255,200,0.12)",
          borderColor: strokeGradient,
          borderWidth: 3,
          tension: 0.4,
          pointRadius(pointContext) {
            const phase = pointContext.chart.$radarPulseFrame || 0;
            return 5 + (Math.sin(phase + (pointContext.dataIndex * 0.9)) * 0.7);
          },
          pointHoverRadius: 8,
          pointBackgroundColor: "#ffffff",
          pointBorderColor: "#00ffc8",
          pointBorderWidth: 2,
          pointHoverBackgroundColor: "#ffffff",
          pointHoverBorderColor: "#b8fff1",
        },
      ],
    },
    options: {
      responsive: true,
      maintainAspectRatio: true,
      aspectRatio: 1,
      layout: {
        padding: {
          top: 20,
          right: 22,
          bottom: 20,
          left: 22,
        },
      },
      animation: {
        duration: 1200,
        easing: "easeOutQuart",
      },
      scales: {
        r: {
          min: 0,
          max: 100,
          ticks: {
            stepSize: 20,
            color: "rgba(255,255,255,0.7)",
            backdropColor: "transparent",
            font: {
              size: 11,
            },
          },
          pointLabels: {
            color: "#cfefff",
            font: {
              size: 14,
              weight: "500",
            },
          },
          grid: {
            color: "rgba(255,255,255,0.06)",
          },
          angleLines: {
            color: "rgba(255,255,255,0.08)",
          },
        },
      },
      plugins: {
        legend: {
          display: false,
        },
        tooltip: {
          enabled: true,
          backgroundColor: "#0f1e2e",
          borderColor: "#00ffc8",
          borderWidth: 1,
          titleColor: "#00ffc8",
          bodyColor: "#ffffff",
          padding: 12,
          cornerRadius: 8,
        },
      },
    },
  });
}

/* -------------------------------------------------------------------------- */
/* 3) Report Renderer                                                          */
/* -------------------------------------------------------------------------- */

function createSectionNode(section) {
  const block = document.createElement("article");
  block.className = "report-preview-section";

  const heading = document.createElement("h4");
  heading.className = "report-preview-heading";
  heading.textContent = section.title;
  block.appendChild(heading);

  if (section.body) {
    const paragraph = document.createElement("p");
    paragraph.className = "report-preview-body";
    paragraph.textContent = section.body;
    block.appendChild(paragraph);
  }

  if (Array.isArray(section.bullets) && section.bullets.length) {
    const list = document.createElement("ul");
    list.className = "report-preview-list";

    section.bullets.forEach((item) => {
      const li = document.createElement("li");
      li.textContent = item;
      list.appendChild(li);
    });

    block.appendChild(list);
  }

  return block;
}

function createMetricChips(report) {
  const wrap = document.createElement("div");
  wrap.className = "report-preview-metrics";

  const chips = [
    `Half-life: ${report.analytics.half_life ?? "--"} years`,
    `Trend: ${report.analytics.trend ?? "--"}`,
    `Salary: ${report.analytics.salary ?? "--"}`,
    `Volatility: ${report.analytics.volatilityIndex ?? "--"}`,
    `Stability: ${report.analytics.stabilityScore ?? "--"}`,
  ];

  chips.forEach((chipText) => {
    const chip = document.createElement("span");
    chip.className = "report-preview-chip";
    chip.textContent = chipText;
    wrap.appendChild(chip);
  });

  return wrap;
}

export function renderReportPreview(report) {
  cacheDom();

  if (!dom.preview) {
    return;
  }

  dom.preview.textContent = "";

  const header = document.createElement("header");
  header.className = "report-preview-header";

  const title = document.createElement("h3");
  title.className = "report-preview-title";
  title.textContent = "Career Intelligence Report Preview";

  const subtitle = document.createElement("p");
  subtitle.className = "report-preview-subtitle";
  subtitle.textContent = `${report.context.skill} • ${report.context.city}, ${report.context.country} • Generated ${report.meta.generatedAtReadable}`;

  header.appendChild(title);
  header.appendChild(subtitle);

  dom.preview.appendChild(header);
  dom.preview.appendChild(createMetricChips(report));

  report.sections.forEach((section) => {
    dom.preview.appendChild(createSectionNode(section));
  });
}

/* -------------------------------------------------------------------------- */
/* 4) PDF Exporter                                                             */
/* -------------------------------------------------------------------------- */

function buildBackendPayload(report) {
  return {
    country: report.context.country,
    city: report.context.city,
    skill: report.context.skill,
    experience: report.context.experience,
  };
}

function downloadBlob(blob, fileName) {
  const url = URL.createObjectURL(blob);
  const anchor = document.createElement("a");
  anchor.href = url;
  anchor.download = fileName;
  document.body.appendChild(anchor);
  anchor.click();
  anchor.remove();
  URL.revokeObjectURL(url);
}

async function exportPdfViaJsPdf(report) {
  if (!window.jspdf || !window.jspdf.jsPDF) {
    throw new Error("jsPDF is not available");
  }

  const doc = new window.jspdf.jsPDF({ unit: "pt", format: "a4" });
  let y = 52;

  doc.setFont("helvetica", "bold");
  doc.setFontSize(18);
  doc.text("Career Intelligence Report", 42, y);
  y += 24;

  doc.setFont("helvetica", "normal");
  doc.setFontSize(10);
  doc.text(`Generated: ${report.meta.generatedAtReadable}`, 42, y);
  y += 16;
  doc.text(`User: ${report.meta.userName}`, 42, y);
  y += 20;

  report.sections.forEach((section) => {
    if (y > 740) {
      doc.addPage();
      y = 52;
    }

    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.text(section.title, 42, y);
    y += 14;

    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);
    const body = section.body || "";
    const lines = doc.splitTextToSize(body, 510);
    doc.text(lines, 42, y);
    y += lines.length * 12 + 8;

    if (Array.isArray(section.bullets)) {
      section.bullets.forEach((bullet) => {
        const bulletLines = doc.splitTextToSize(`• ${bullet}`, 500);
        doc.text(bulletLines, 52, y);
        y += bulletLines.length * 12;
      });
      y += 6;
    }

    doc.setDrawColor(200, 220, 255);
    doc.line(42, y, 552, y);
    y += 10;
  });

  doc.save(`career_intelligence_${report.context.country}_${report.context.city}_${report.context.skill}.pdf`);
}

export async function downloadReportPDF(report) {
  const useReport = report || reportState.latestReport;
  if (!useReport) {
    throw new Error("Please analyze a skill before generating report.");
  }

  try {
    const payload = buildBackendPayload(useReport);
    const { blob, fileName } = await downloadReport(payload);
    downloadBlob(blob, fileName || "career_intelligence_report.pdf");
    return;
  } catch (error) {
    console.warn("Backend PDF generation failed, trying jsPDF fallback:", error);
  }

  await exportPdfViaJsPdf(useReport);
}

export function exportReportJSON(report) {
  const useReport = report || reportState.latestReport;
  if (!useReport) {
    throw new Error("Please analyze a skill before generating report.");
  }

  const json = JSON.stringify(useReport, null, 2);
  const blob = new Blob([json], { type: "application/json" });
  const fileName = `career_intelligence_${useReport.context.country}_${useReport.context.city}_${useReport.context.skill}.json`;
  downloadBlob(blob, fileName);
}

/* -------------------------------------------------------------------------- */
/* 5) Backend Sync + Button Wiring                                             */
/* -------------------------------------------------------------------------- */

export async function syncReportWithBackend(report) {
  const useReport = report || reportState.latestReport;
  if (!useReport) {
    throw new Error("Please analyze a skill before generating report.");
  }

  const payload = buildBackendPayload(useReport);
  const { blob, fileName } = await downloadReport(payload);
  return { blob, fileName };
}

function notifyNoAnalytics() {
  alert("Please analyze a skill before generating report.");
}

async function handleDownloadButtonClick() {
  try {
    updateSelectionStateFromDOM();

    if (!reportState.analytics) {
      notifyNoAnalytics();
      return;
    }

    const report = generateReport(reportState.analytics);
    renderReportPreview(report);
    await downloadReportPDF(report);
  } catch (error) {
    console.error("Report generation error:", error);
    alert(error.message || "Unable to generate report right now.");
  }
}

export function initializeReportModule(options = {}) {
  cacheDom();
  setReportContext(options);

  if (dom.downloadButton) {
    dom.downloadButton.addEventListener("click", handleDownloadButtonClick);
  }
}

export function updateReportAnalytics(analytics) {
  reportState.analytics = analytics;
}

export function getLatestReport() {
  return reportState.latestReport;
}

export async function generateAndDownloadReport(selection, analytics = null) {
  setReportContext({ ...selection, analytics });

  const source = analytics || reportState.analytics;
  if (!source) {
    throw new Error("Please analyze a skill before generating report.");
  }

  const report = generateReport(source);
  await downloadReportPDF(report);
  return report;
}

if (typeof window !== "undefined") {
  window.generateReport = generateReport;
  window.buildReportSections = buildReportSections;
  window.renderReportPreview = renderReportPreview;
  window.downloadReportPDF = downloadReportPDF;
  window.exportReportJSON = exportReportJSON;
}

